#tos
  max-height: 500px
</style>

<script lang='ts'>
import Vue from 'vue';
import Button from '@/components/Button.vue';
import Header from '@/components/Header.vue';

export default Vue.extend({
  name: 'Level5',
  components: {
    Button,
    Header,
  },
  data() {
    return {
      onTop: false,
      onBottom: false,
      startTime: 0,
      scrollTime: 0,
      /**
       * The minimum time you have to scroll in ms.
       */
      MIN_SCROLL_TIME: 10_000,
      /**
       * The minimum time you have to scroll in ms.
       */
      MAX_SCROLL_TIME: 20_000,
    };
  },
  mounted() {
    // For debugging. Updates the scrolltime variable every 10 ms.
    this.$nextTick(function(): void {
      window.setInterval(() => {
        this.updateScrollTime();
      }, 10);
    });
  },
  methods: {
    /**
     * Checks if the scrollbar is on top or on bottom. Sets the start time to the current time
     * if the scrollbar is on top.
     */
    onScroll(
      {target: { scrollTop, clientHeight, scrollHeight}}:
      {target: {scrollTop: number, clientHeight: number, scrollHeight: number}},
    ): void {
      this.onTop = scrollTop <= 0;
      this.onBottom = scrollTop + clientHeight >= scrollHeight - 300;

      if (this.onTop) {
        this.startTime = new Date().getTime();
      }

      if (this.onBottom) {
        if (this.scrollTime < this.MIN_SCROLL_TIME) {
          console.log('you scrolled to FAST');
        } else if (this.scrollTime > this.MAX_SCROLL_TIME) {
          console.log('you scrolled to SLOW');
        } else {
          console.log('OK !');
        }
      }
    },

    /**
     * Updates the scrolltime variable to represent how long the user has been scrolling
     * since it was located at the top.
     */
    updateScrollTime(): void {
      this.scrollTime = new Date().getTime() - this.startTime;
    },

    /**
     * Returns the scroll time in a readable format in seconds with two decimals.
     *
     * @returns the scroll time in a readable format in seconds with two decimals.
     */
    getPrettyScrollTime(): number {
      const seconds = this.scrollTime / 1000;
      return Math.round(seconds * 100) / 100;
    },
  },
});
</script>
